export function SobaIcon ( { size = "small" } : { size?: "small" | "large" } ) {
    const sizes = {
        small: 20,
        large: 24,
    };

    const iconsize = sizes[size];

    return(
        <svg 
            viewBox={`0 0 {iconsize} {iconsize}`}
            width={iconsize}
            height={iconsize}
        >
            <image
                width={iconsize}
                height={iconsize}
                xlinkHref="data:image/png;base64,
                "/>
        </svg>
    );
}